# --- Load CVI config (refactored JSON structure with meta, palette, classes, weights) ---
def load_config(path_candidates):
    """
    Try loading a CVI config JSON file from a list of candidate paths.
    Returns (config_dict, path_used).
    """
    if isinstance(path_candidates, str):
        path_candidates = [path_candidates]
    for p in path_candidates:
        try:
            with open(p, "r", encoding="utf-8") as f:
                cfg_local = json.load(f)
            print(f"Loaded config from: {p}")
            return cfg_local, p
        except Exception:
            continue
    raise FileNotFoundError("Could not find a valid CVI config JSON in provided paths.")

cfg, CONFIG_PATH = load_config([CONFIG_PATH])

# --- Extract meta info ---
meta = cfg.get("meta", {})

# Build registry of parameters (order, label, unit, type) from meta
param_meta = {
    p["key"]: {
        "order": p.get("order"),
        "label": p.get("label"),
        "unit": p.get("unit"),
        "type": p.get("type", "numeric")
    }
    for p in meta.get("parameters", [])
}

# Keys to score (exclude total index itself)
param_keys = [k for k in param_meta if k != "total_cvi"]

print("Parameters found:", param_keys)
display(pd.DataFrame(param_meta).T)


# --- Folium legend helper ---
def add_folium_legend(m, cfg, param_key, title=None, position="bottomleft", mode="fixed"):
    """
    Add a legend to a Folium map using parameter classes from config.

    Supports:
      • For regular parameters → cfg[param_key]["classes"]
      • For total_cvi → cfg["total_cvi"]["fixed" | "quintile"]

    Args:
        m (folium.Map): Map object
        cfg (dict): CVI config
        param_key (str): Parameter key, e.g. "slope", "erosion", "total_cvi"
        title (str): Legend title (defaults to parameter label)
        position (str): bottomleft | bottomright | topleft | topright
        mode (str): "fixed" or "quintile" (used only for total_cvi)
    """
    if param_key not in cfg:
        raise ValueError(f"Parameter {param_key} not found in config")

    param_cfg = cfg[param_key]

    # Select which classes to display
    if param_key == "total_cvi":
        classes = param_cfg.get(mode, {})
    else:
        classes = param_cfg.get("classes", {})

    # Default title from meta
    if not title:
        meta_params = {p["key"]: p for p in cfg["meta"].get("parameters", [])}
        title = meta_params.get(param_key, {}).get("label", param_key)

    # Positioning CSS
    pos_css = {
        "bottomleft":  ("50px", "50px"),
        "bottomright": ("50px", "auto"),
        "topleft":     ("auto", "50px"),
        "topright":    ("auto", "auto"),
    }
    bottom, left = pos_css.get(position, ("50px", "50px"))

    # Legend HTML
    legend_html = f"""
    <div style="
        position: fixed;
        bottom: {bottom};
        left: {left};
        width: 280px;
        background-color: white;
        padding: 10px;
        border: 2px solid black;
        z-index: 9999;
        font-size: 13px;
    ">
        <b>{title}</b><br>
    """

    for rank, spec in classes.items():
        if not isinstance(spec, dict):
            continue

        # Get color (explicit or palette)
        if "color" in spec:
            color = spec["color"]
        elif "palette" in spec:
            color = cfg["meta"]["default_palette"][str(spec["palette"])]["color"]
        else:
            color = "gray"

        label = spec.get("label", f"Class {rank}")

        # Extra info (ranges or codes)
        extra = ""
        if "range" in spec:
            extra = f" ({spec['range']})"
        elif "min" in spec or "max" in spec:
            minv, maxv = spec.get("min"), spec.get("max")
            if minv is not None and maxv is not None:
                extra = f" ({minv} – {maxv})"
            elif minv is not None:
                extra = f" (≥ {minv})"
            elif maxv is not None:
                extra = f" (≤ {maxv})"

        legend_html += f'<i style="color:{color};">&#x25A0;</i> {label}{extra}<br>'

    legend_html += "</div>"

    m.get_root().html.add_child(folium.Element(legend_html))
    return m
